import React from 'react';
import './Features.css';

const Features = () => {
  return (
    <section className="features">
      <h3>Explore Our Features</h3>
      <div className="feature-buttons">
        <button>Personalized Diet Plan</button>
        <button>Health Food Store</button>
        <button>Community Hub</button>
      </div>
    </section>
  );
};

export default Features;
